import React from "react";
import { AiOutlinePlus } from 'react-icons/ai';

function  EnfantCard (props) {
return (
<div>
<div className=" grid grid-cols-2 text-center items-center w-full border-b-2 border-red-100 border-t-2 my-3 ">
        <button className="bg-[#FB9B90]   w-fit rounded-md font-medium text-center  text-[#191A43] ring-2 ring-[#ED6361] hover:bg-[#5B112B] hover:text-white hover:scale-105 duration-300" title="Ajouter">
          < AiOutlinePlus size={20} className=' text-center cursor-pointer mx-1 my-1 xs:mx-3 xs:my-2 md:mx-5 md:my-4' />
        </button>
        <button className="bg-[#FB9B90] ml-[75%]  w-fit rounded-md font-medium text-center  text-[#191A43] ring-2 ring-[#ED6361] hover:bg-[#5B112B] hover:text-white hover:scale-105 duration-300" title="Ajouter">
          < AiOutlinePlus size={20} className=' text-center cursor-pointer mx-1 my-1 xs:mx-3 xs:my-2 md:mx-5 md:my-4' />
        </button>
 </div>
    <h1> {props.nom} </h1>
    <h1> {props.Age} </h1>
    <img className=" mx-auto mt-2 w-[80%] "  src={props.image} alt="" /> 
</div>
    
)


}

export default EnfantCard;
